"use strict";(self.webpackChunky_doc=self.webpackChunky_doc||[]).push([[8130],{7735:n=>{n.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"updateYbc","metadata":{"permalink":"/blog/updateYbc","editUrl":"https://github.com/xYuan20d/Yuml-doc/edit/main/blog/updateYbc.md","source":"@site/blog/updateYbc.md","title":"\u2728 Yuml \u67b6\u6784\u5347\u7ea7\uff1a\u6211\u4eec\u5982\u4f55\u7528 SQLite \u5b9e\u73b0 YAML \u7684\u60f0\u6027\u52a0\u8f7d\u4e0e\u7f16\u8bd1\u6267\u884c","description":"Yuml \u65b0\u7248\u672c\u5f15\u5165\u4e86\u4e00\u9879\u5173\u952e\u6027\u7684\u5e95\u5c42\u5347\u7ea7 \u2014\u2014","date":"2025-07-01T00:00:00.000Z","tags":[{"inline":false,"label":"Yuml","permalink":"/blog/tags/Yuml","description":"\u6b22\u8fce\u6765\u5230Yuml\u6807\u7b7e"}],"readingTime":2.81,"hasTruncateMarker":true,"authors":[{"name":"YuanYuan","title":"Yuml \u8bed\u8a00\u4f5c\u8005","url":"https://github.com/xYuan20d","socials":{"github":"https://github.com/xYuan20d"},"page":{"permalink":"/blog/authors/YuanYuan"},"imageURL":"https://github.com/xYuan20d.png","key":"yuan"}],"frontMatter":{"slug":"updateYbc","title":"\u2728 Yuml \u67b6\u6784\u5347\u7ea7\uff1a\u6211\u4eec\u5982\u4f55\u7528 SQLite \u5b9e\u73b0 YAML \u7684\u60f0\u6027\u52a0\u8f7d\u4e0e\u7f16\u8bd1\u6267\u884c","date":"2025-07-01T00:00:00.000Z","authors":["yuan"],"tags":["Yuml"]},"unlisted":false,"nextItem":{"title":"\u7b2c\u4e00\u6761\u5e16\u5b50","permalink":"/blog/post1"}},"content":"Yuml \u65b0\u7248\u672c\u5f15\u5165\u4e86\u4e00\u9879\u5173\u952e\u6027\u7684\u5e95\u5c42\u5347\u7ea7 \u2014\u2014  \\n\u6211\u4eec\u91cd\u65b0\u8bbe\u8ba1\u4e86\u89e3\u6790\u6267\u884c\u7684\u6574\u4e2a\u6d41\u7a0b\uff0c**\u544a\u522b\u91cd\u590d\u6e32\u67d3 + \u5168\u91cf\u52a0\u8f7d\u7684\u65f6\u4ee3**\uff0c\u6b63\u5f0f\u8fc8\u5165 **\u5b57\u8282\u7801 + \u60f0\u6027\u52a0\u8f7d\u7684\u9ad8\u6027\u80fd\u9636\u6bb5**\u3002\\n\\n\x3c!--truncate--\x3e\\n\\n## \ud83e\udde0 \u95ee\u9898\u56de\u987e\uff1a\u65e7\u67b6\u6784\u7684\u74f6\u9888\\n\\n\u65e7\u7248\u672c\u4e2d\uff0cYuml \u7684\u542f\u52a8\u6d41\u7a0b\u5982\u4e0b\uff1a\\n\\n1. \u8bfb\u53d6\u539f\u59cb `.yaml` \u6587\u4ef6\uff1b\\n2. \u901a\u8fc7 `jinja2` \u6e32\u67d3\u6a21\u677f\u903b\u8f91\uff1b\\n3. \u4f7f\u7528 `ruamel.yaml` \u89e3\u6790 YAML\uff1b\\n4. \u8f6c\u6362\u4e3a `dict` \u4f9b\u89e3\u91ca\u5668\u8fd0\u884c\u3002\\n\\n\u8fd9\u79cd\u65b9\u5f0f\u867d\u5bf9\u5c0f\u578b\u9879\u76ee\u8db3\u591f\uff0c\u4f46\u5f53 YAML \u6587\u4ef6\u5d4c\u5957\u7ed3\u6784\u590d\u6742\u3001\u6a21\u5757\u4f17\u591a\u65f6\uff0c\u95ee\u9898\u663e\u73b0\uff1a\\n\\n- \u23f3 **\u542f\u52a8\u7f13\u6162**\uff1a\u6bcf\u6b21\u91cd\u590d\u6267\u884c jinja2 \u6e32\u67d3\u548c YAML \u89e3\u6790\uff1b\\n- \ud83d\udca5 **\u5185\u5b58\u6fc0\u589e**\uff1a\u4e00\u6b21\u6027\u52a0\u8f7d\u6574\u4e2a\u5b57\u5178\u7ed3\u6784\uff1b\\n- \ud83d\udc0c **\u6027\u80fd\u968f\u9879\u76ee\u89c4\u6a21\u52a3\u5316**\uff1a\u8d8a\u5927\u8d8a\u5361\uff0c\u8d8a\u591a\u8d8a\u6162\u3002\\n\\n\u56e0\u6b64\uff0c\u6211\u4eec\u51b3\u5b9a\u5f7b\u5e95\u91cd\u6784\u8fd0\u884c\u6838\u5fc3\u3002\\n\\n---\\n\\n## \u2728 \u65b0\u67b6\u6784\uff1aybc \u5b57\u8282\u7801\u7cfb\u7edf\u4e0a\u7ebf\uff01\\n\\n\u6211\u4eec\u8bbe\u8ba1\u4e86\u4e00\u79cd\u5168\u65b0\u673a\u5236\uff1a\\n\\n> **\u5c06 YAML \u7f16\u8bd1\u4e3a SQLite \u5b58\u50a8\u7ed3\u6784\uff08.ybc\uff09\uff0c\u8fd0\u884c\u65f6\u6309\u9700\u8bbf\u95ee\u3002**\\n\\n`.ybc` \u662f\u4e00\u79cd\u7ed3\u6784\u5316\u952e\u503c\u6570\u636e\u5e93 + \u5b57\u8282\u7801\u5bb9\u5668\uff0c\u5177\u5907\u4ee5\u4e0b\u4f18\u52bf\uff1a\\n\\n### \ud83d\udd25 \u4e00\u6b21\u7f16\u8bd1\uff0c\u591a\u6b21\u8fd0\u884c\\n\\n- \u521d\u6b21\u6784\u5efa\u65f6\uff0c`.yaml` \u88ab\u7f16\u8bd1\u4e3a `.ybc`\uff1b\\n- \u7f16\u8bd1\u6d41\u7a0b\u5b8c\u6210\u6a21\u677f\u6e32\u67d3\u3001AST \u62bd\u53d6\u3001\u7ed3\u6784\u5199\u5165 SQLite\uff1b\\n- \u8fd0\u884c\u9636\u6bb5\u76f4\u63a5\u8bfb\u53d6 `.ybc`\uff0c**\u65e0\u9700\u518d\u89e3\u6790\u539f\u59cb YAML**\u3002\\n\\n### \u2744\ufe0f \u60f0\u6027\u52a0\u8f7d\uff1a\u53ea\u52a0\u8f7d\u88ab\u7528\u5230\u7684\u5185\u5bb9\\n\\n\u65e7\u7248\u52a0\u8f7d\u6574\u4e2a dict\uff0c\u65b0\u7248\u5219\uff1a\\n\\n> **\u8fd0\u884c\u65f6\u4ec5\u52a0\u8f7d\u8bbf\u95ee\u5230\u7684\u952e\uff0c\u800c\u975e\u6574\u68f5 YAML \u6811\u3002**\\n\\n\u5b9e\u6d4b\uff084.6 \u4e07\u884c\u3001\u65e0\u6a21\u677f\uff09\uff1a\\n\\n| \u683c\u5f0f | \u542f\u52a8\u65f6\u95f4 | \u5185\u5b58\u5360\u7528 |\\n|------|----------|----------|\\n| YAML | 3.2 \u79d2   | 186 MB   |\\n| YBC  | 0.04 \u79d2  | 90 MB    |\\n\\n---\\n\\n## \u2699\ufe0f JIT \u6a21\u677f\u5f15\u64ce\uff1a\u5b57\u7b26\u4e32\u6e32\u67d3\u6027\u80fd\u7a81\u7834\\n\\n\u6a21\u677f\u5b57\u7b26\u4e32\uff08\u5982 `{< time.time() >}`\uff09\u662f Yuml \u7684\u6838\u5fc3\u8bed\u6cd5\u3002\u65e7\u7248\u672c\u6bcf\u6b21\u6e32\u67d3\uff1a\\n\\n1. \u6b63\u5219\u62c6\u5206\u8868\u8fbe\u5f0f\uff1b\\n2. `eval` \u6267\u884c\uff1b\\n3. \u62fc\u63a5\u6e32\u67d3\u8f93\u51fa\u3002\\n\\n### \ud83c\udf00 \u95ee\u9898\uff1a\\n\\n\u5728\u5faa\u73af\u4e2d\u53cd\u590d\u6e32\u67d3\u6a21\u677f\uff08\u5982 `range(100000)`\uff09\u4f1a\u4ea7\u751f\u5927\u91cf\u91cd\u590d\u89e3\u6790\u548c\u6267\u884c\uff0c\u6d6a\u8d39\u6027\u80fd\u3002\\n\\n---\\n\\n### \ud83d\ude80 \u65b0\u65b9\u6848\uff1a\u8868\u8fbe\u5f0f\u7ea7 JIT \u7f13\u5b58\\n\\n\u65b0\u7248\u672c\u5185\u7f6e\u667a\u80fd\u6a21\u677f\u7f13\u5b58\u5f15\u64ce\uff0c\u53ef\u81ea\u52a8\u8bc6\u522b **\u9ad8\u9891\u8868\u8fbe\u5f0f** \u5e76\u7f16\u8bd1\u4e3a `lambda` \u51fd\u6570\uff1a\\n\\n- \ud83d\udccc \u7b2c\u4e00\u6b21\u51fa\u73b0\uff1a\u5e38\u89c4\u89e3\u6790\uff1b\\n- \ud83d\udccc \u51fa\u73b0 \u22653 \u6b21\uff1a\u6807\u8bb0\u4e3a\u70ed\u70b9\u8868\u8fbe\u5f0f\uff1b\\n- \ud83d\udccc \u540e\u7eed\u4f7f\u7528\uff1a\u590d\u7528\u5df2\u7f16\u8bd1 lambda\uff0c\u8df3\u8fc7\u6b63\u5219\u4e0e eval\uff1b\\n\\n\u8fd9\u5c31\u662f Yuml \u7684 **\u8868\u8fbe\u5f0f\u7ea7 JIT \u7f16\u8bd1**\u3002\\n\\n### \u26a0\ufe0f \u7f13\u5b58\u201c\u8868\u8fbe\u5f0f\u201d\uff0c\u800c\u975e\u201c\u7ed3\u679c\u201d\uff01\\n\\n\u6211\u4eec\u53ea\u7f13\u5b58\u8868\u8fbe\u5f0f\u7684\u53ef\u6267\u884c\u51fd\u6570\uff0c\u4e0d\u7f13\u5b58\u5176\u503c\uff1a\\n\\n```yaml\\n{< time.time() >}  # \u6bcf\u6b21\u7ed3\u679c\u4e0d\u540c\uff0c\u4e0d\u80fd\u7f13\u5b58\u7ed3\u679c\uff0c\u53ea\u80fd\u7f13\u5b58 lambda\\n```\\n\\n---\\n\\n## \ud83e\uddea \u793a\u4f8b\u5bf9\u6bd4\uff1a\u65e7 vs \u65b0\\n\\n```yaml\\nrun:\\n  $app::comImportPackage: [[\\"from time import perf_counter\\", \\"perf_counter\\"], {}]\\n  \\\\>start_time: perf_counter()\\n  FOR:\\n    ITER: range(100000)\\n    CODE:\\n      CALL_BLOCK: [\\"{< \'test\' >}\\", [\\"{< 1+1 >} :int\\"]]\\n  LOG: \\"{< perf_counter() - start_time >}\\"\\n\\ntest: {}\\n```\\n\\n| \u6a21\u5f0f | \u603b\u8017\u65f6 |\\n|------|--------|\\n| \u65e7\u7248 | 1.53s  |\\n| \u65b0\u7248\uff08\u542b JIT\uff09 | **1.34s** \u2714\ufe0f |\\n\\n\u6a21\u677f\u8c03\u7528\u8d8a\u9891\u7e41\uff0c\u63d0\u901f\u8d8a\u660e\u663e\uff01\\n\\n---\\n\\n## \ud83d\udee0\ufe0f \u53cc\u6a21\u5f0f\u652f\u6301\uff1a\u5f00\u53d1 & \u90e8\u7f72\u65e0\u7f1d\u5207\u6362\\n\\n\u65b0\u67b6\u6784\u4fdd\u7559\u53cc\u6a21\u5f0f\uff0c\u517c\u987e\u7075\u6d3b\u4e0e\u6027\u80fd\uff1a\\n\\n| \u6a21\u5f0f | \u63cf\u8ff0 | \u9002\u7528\u573a\u666f |\\n|------|------|----------|\\n| `.yaml` \u76f4\u8dd1 | \u52a8\u6001\u89e3\u6790\uff0c\u6613\u8c03\u8bd5 | \u672c\u5730\u5f00\u53d1\u3001\u5feb\u901f\u8fed\u4ee3 |\\n| `.ybc` \u7f16\u8bd1\u6267\u884c | \u60f0\u6027 + \u7f13\u5b58 | \u6b63\u5f0f\u90e8\u7f72\u3001\u6027\u80fd\u654f\u611f |\\n\\n---\\n\\n## \ud83c\udfaf \u603b\u7ed3\\n\\nYuml \u65b0\u67b6\u6784\u5177\u5907\uff1a\\n\\n- \u2705 **\u5b57\u8282\u7801\u7ea7\u865a\u62df\u6267\u884c\u7cfb\u7edf**\\n- \u26a1 **\u8868\u8fbe\u5f0f\u7ea7 JIT \u7f13\u5b58\u673a\u5236**\\n- \ud83e\uddca **\u60f0\u6027\u5185\u5b58\u8c03\u5ea6\u5f15\u64ce**\\n- \ud83e\uddec **\u5b8c\u6574\u52a8\u6001\u8bed\u8a00\u652f\u6301**\\n\\n> \u6211\u4eec\u6ca1\u6709\u727a\u7272\u52a8\u6001\u6027\uff0c\u800c\u662f\u7528\u5de5\u7a0b\u80fd\u529b\u5b88\u62a4\u5b83\u3002  \\n> \u65b0\u67b6\u6784\uff0c\u8ba9 Yuml \u66f4\u5feb\u3001\u66f4\u8f7b\u3001\u66f4\u5f3a\u3002"},{"id":"post1","metadata":{"permalink":"/blog/post1","editUrl":"https://github.com/xYuan20d/Yuml-doc/edit/main/blog/post1.md","source":"@site/blog/post1.md","title":"\u7b2c\u4e00\u6761\u5e16\u5b50","description":"\u2728 \u6b22\u8fce\u6765\u5230\u672c\u7ad9\u7684\u7b2c\u4e00\u7bc7\u5e16\u5b50\uff01\ud83c\udf89","date":"2025-06-22T00:00:00.000Z","tags":[{"inline":false,"label":"Hello","permalink":"/blog/tags/hello","description":"Hello tag description"}],"readingTime":0.16,"hasTruncateMarker":true,"authors":[{"name":"YuanYuan","title":"Yuml \u8bed\u8a00\u4f5c\u8005","url":"https://github.com/xYuan20d","socials":{"github":"https://github.com/xYuan20d"},"page":{"permalink":"/blog/authors/YuanYuan"},"imageURL":"https://github.com/xYuan20d.png","key":"yuan"}],"frontMatter":{"slug":"post1","title":"\u7b2c\u4e00\u6761\u5e16\u5b50","date":"2025-06-22T00:00:00.000Z","authors":["yuan"],"tags":["hello"]},"unlisted":false,"prevItem":{"title":"\u2728 Yuml \u67b6\u6784\u5347\u7ea7\uff1a\u6211\u4eec\u5982\u4f55\u7528 SQLite \u5b9e\u73b0 YAML \u7684\u60f0\u6027\u52a0\u8f7d\u4e0e\u7f16\u8bd1\u6267\u884c","permalink":"/blog/updateYbc"}},"content":"\u2728 \u6b22\u8fce\u6765\u5230\u672c\u7ad9\u7684\u7b2c\u4e00\u7bc7\u5e16\u5b50\uff01\ud83c\udf89\\n\\n\u5982\u679c\u4f60\u4e0d\u5acc\u9ebb\u70e6\uff0c\u6b22\u8fce\u70b9\u51fb\u53f3\u4e0b\u65b9\u7684\u300c\ud83d\udcac\u300d\u6309\u94ae \ud83d\udc49  \\n\u767b\u5f55\u4e00\u4e0b\uff0c\u7559\u8a00\u300c\u5230\u6b64\u4e00\u6e38\u300d\uff0c\u8ba9\u6211\u77e5\u9053\u4f60\u6765\u8fc7\\n\\n\x3c!--truncate--\x3e\\nCiallo\uff5e(\u2220\u30fb\u03c9< )\u2312\u2605"}]}}')}}]);